import React from 'react'; 
import ReactDOM from 'react-dom';
import './app.css'; 
import App from './app'; 
import Chatbot from './chatbot';
import Header from './header';
import Pizza from './italy/pizza/pizza';

function Home (){

ReactDOM.render(
  <React.StrictMode>
    <Header/>
    <Pizza />
    <Chatbot />
  </React.StrictMode>,
  document.getElementById('root') 
);
}
export default Home;
